import React, {FC, InputHTMLAttributes} from "react";

interface InputProps extends InputHTMLAttributes<HTMLInputElement> {
    type: string;
    name: string;
}

const Input: FC<InputProps> = ({type, name}) => {
    return (
        <input type={type} name={name}/>
    )
}

export default Input;
